import React,{Component} from "react";

class Nav extends Component{
  render(){
    return(
      <nav>
        <h2>THis is nav</h2>
        <a href="#">Home</a> |
        <a href="#">About</a> |
        <a href="#">Gallery</a>
      </nav>
    
    )
  }
}

export default Nav;
